// Import statements
import React, { useState } from 'react';
import { Container, Row, Col, Form, InputGroup } from 'react-bootstrap';
import { AiOutlineSearch } from 'react-icons/ai';
import 'bootstrap/dist/css/bootstrap.min.css';
import './EmployeeCard.css';

const EmployeeCardData = ({ empId, name, dob, position, cardNumber, isHighlighted }) => {
  return (
    <form>
      <div className={`employee-card ${isHighlighted ? 'highlight' : ''}`}>
        <div className="card-number">{cardNumber}</div>
        <div className="card-details">
          <div className="label-container">
            <label htmlFor="empId"><strong>EMP ID:</strong></label>
            <span id="empId">{empId}</span>
          </div>
          <div className="label-container">
            <label htmlFor="name"><strong>Name:</strong></label>
            <span id="name">{name}</span>
          </div>
          <div className="label-container">
            <label htmlFor="dob"><strong>DOB:</strong></label>
            <span id="dob">{dob}</span>
          </div>
          <div className="label-container">
            <label htmlFor="position"><strong>Role:</strong></label>
            <span id="position">{position}</span>
          </div>
        </div>
      </div>
    </form>
  );
};

const EmployeeCard = () => {
  const initialEmployeeData = [
    { empId: 101, name: 'Rahul', dob: '27-11-2001', position: 'Software Engineer', cardNumber: 1 },
    { empId: 102, name: 'Prasad', dob: '20-03-2000', position: 'Program M', cardNumber: 2 },
    { empId: 103, name: 'Shreyas', dob: '11-09-2002', position: 'Data Scientist', cardNumber: 3 },
    { empId: 104, name: 'Sachin', dob: '23-11-2000', position: 'UX Designer', cardNumber: 4 },
  ];

  const [searchInput, setSearchInput] = useState('');
  const [typedEmpId, setTypedEmpId] = useState('');
  const [employeeData, setEmployeeData] = useState(initialEmployeeData);

  const handleSearch = (e) => {
    const inputValue = e.target.value.toLowerCase();
    setSearchInput(inputValue);
    setTypedEmpId(inputValue);
    const filteredEmployees = initialEmployeeData.filter((employee) =>
      employee.name.toLowerCase().includes(inputValue)
    );
    setEmployeeData(filteredEmployees);
  };

  return (
    <Container>
      <Row>
        <Col xs={12} className="mb-3">
          <InputGroup>
            <Form.Control
              type="text"
              placeholder="Search by employee name or ID"
              className="search-input"
              value={searchInput}
              onChange={handleSearch}
            />
            <InputGroup.Text className="search-icon">
              <AiOutlineSearch style={{ fontSize: '1.5rem', color: '#36A54680' }} />
            </InputGroup.Text>
          </InputGroup>
        </Col>
        {employeeData.map((employee) => (
          <Col key={employee.empId} xs={12} sm={6} md={4} lg={3}>
            <EmployeeCardData {...employee} isHighlighted={typedEmpId === employee.empId.toString()} />
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default EmployeeCard;
